const initialIngredientsList = { name: '', price: '', quantity: '' }


export function CreateRecipe() {
    const [inputList, setInputList] = useState(Array.from({ length: 5 }, () => ({ instruction: "" }))); //We start with length of five empty fields
    const [instructionlist, setInstructionlist] = useState([]);
    const [ingredientsList, setIngredientsList] = useState([initialIngredientsList])
    const [recipeName, setRecipeName] = useState([])
    const [ingredientsrender, setIngredientsrender] = useState([])



    // useEffect says that this function should re-render the UI and any changes to variables in [] should also re-run this function
    useEffect(() => {
        setInstructiondummy(updateinstructions())
        setIngredientsrender(updateingredients())
    }, [inputList, ingredientsList])

    // Writes to recipe table but if already there should update it?
    async function saveRecipe() {
        try {
            const user = await Auth.currentAuthenticatedUser()
            console.log('user: ', user)
            
        } catch (error) {
            console.log("You need to be logged in to add recipe")
            return
        }
        const user = await Auth.currentAuthenticatedUser()
        const username = user.username
        const idvalue = username.concat("--",recipeName)



        try {
            console.log("recipesave_clicked1")
            const ingredientstopush = ingredientsList.map((ingredient) => {
                return ingredient.name
            })

            const recipe = { id: idvalue, name: recipeName, instructions: instructionlist, ingredients: ingredientstopush }
            console.log(recipe)
            try {
                await API.graphql({ query: createRecipes, variables: { input: recipe }, authMode: 'AMAZON_COGNITO_USER_POOLS' })
                console.log("added ", { recipe }, " to database")
            } catch (error) {
                console.log("Failed to create, try update instead")
                await API.graphql({ query: updateRecipes, variables: { input: recipe }, authMode: 'AMAZON_COGNITO_USER_POOLS' })
                console.log("Updated recipe")
            }

        } catch (err) {
            console.log('error creating recipe:', err)
        }
    }


    function getInstructions(inputList) {
        var instructions = [];
        for (var i = 0; i < inputList.length; i++) {
            instructions.push(inputList[i].instruction);
        }
        return instructions;
    }

    // handle input change
    async function handleInputChange(e, index) {
        const { name, value } = e.target;
        const list = [...inputList];
        const skip = value.indexOf(" ") + 1
        list[index][name] = value.substring(skip);
        setInputList(list);
        const instructions = getInstructions(list)
        setInstructionlist(instructions)
        // setInstructiondummy(updateinstructions(list))

    };

    // handle click event of the Remove button
    const handleRemoveClick = index => {
        console.log("CLICKED REMOVE")
        const list = [...inputList];
        list.splice(index, 1);
        setInputList(list);
        // setInstructiondummy(updateinstructions(list))
        console.log("END CLICKED REMOVE")
    };

    // handle click event of the Add button
    async function handleAddClick() {
        console.log("CLICKED ADD")
        const list = [...inputList, { instruction: "" }]
        setInputList(list);
        // setInstructiondummy(updateinstructions(list))
        console.log("END CLICKED ADD")
    };

    // handle click event of the Add button
    async function handleAddIngrediensClick() {
        console.log("CLICKED ADD INGREDIENT")
        const list = [...ingredientsList, { name: "", price: '', quantity: '' }]
        setIngredientsList(list);
        // setInstructiondummy(updateinstructions(list))
        console.log("END CLICKED ADD INGREDIENT")
    };

    // handle click event of the Remove button
    const handleRemoveIngredientsClick = index => {
        console.log("CLICKED REMOVE INGREDIENT")
        const list = [...ingredientsList];
        list.splice(index, 1);
        setIngredientsList(list);
        // setInstructiondummy(updateinstructions(list))
        console.log("END CLICKED REMOVE INGREDIENT")
    };

    async function handleIngredientSelect(e, index) {
        const list = [...ingredientsList];
        list[index]["name"] = e.value
        list[index]["price"] = ''
        list[index]["quantity"] = ''
        console.log(list)
        setIngredientsList(list);
    }

    //  If I use the updateinstructions as function it will re-run everytime useeffect runs. Which means we re-run a lot of times.
    //   const [instructiondummy, setInstructiondummy] = useState([updateinstructions(inputList)]);
    const [instructiondummy, setInstructiondummy] = useState([]);

    function updateinstructions() {
        console.log("updateinstructions")
        const newinstructionlist = inputList.map((instruction, i) => {
            return <div>
                <Row>
                    <Col sm={10}>
                        <Form.Control as="textarea" name="instruction" placeholder="Enter your instruction here" style={{ height: '100px' }} size="lg"
                            value={`${i + 1}. ${instruction.instruction}`} onChange={e => handleInputChange(e, i)}
                        />
                    </Col>
                    <Col sm={2}>
                        {inputList.length !== 1 && <Button
                            className="mr10"
                            onClick={() => handleRemoveClick(i)} style={{ width: '10px' }}>-</Button>}
                        {inputList.length - 1 === i && <Button onClick={handleAddClick} style={{ width: '10px' }}>+</Button>}
                    </Col>
                </Row>
            </div>
        })

        console.log("end updateinstructions")
        return newinstructionlist
    }

    function updateingredients() {
        console.log("updateingredients")
        const newingredientsrender = ingredientsList.map((ingredient, i) => {
            console.log("Ingredient name for list item", i)
            console.log(ingredient.name)
            return <div>

                <Row>
                    <Col sm={10}>
                        <Select
                            options={validIngredients}
                            name="ingredient" placeholder="Select your ingredient here"
                            onChange={e => handleIngredientSelect(e, i)}
                        />
                    </Col>
                    <Col sm={2}>
                        {ingredientsList.length !== 1 && <Button
                            className="mr10"
                            onClick={() => handleRemoveIngredientsClick(i)} style={{ width: '10px' }}>-</Button>}
                        {ingredientsList.length - 1 === i && <Button onClick={handleAddIngrediensClick} style={{ width: '10px' }}>+</Button>}
                    </Col>
                </Row>
            </div>
        })

        console.log("end updateinstructions")
        return newingredientsrender
    }


    return (


        <Container>
            <Row>
                <Card className='my-3' style={{ color: "#000" }}>
                    <Card.Body>
                        <Card.Title> <h1>Welcome to our recipe creator</h1></Card.Title>
                        <Card.Text>
                            <p>Here you can upload images of your recipe, add ingredients and instructions to share for the entire world.</p>
                            <ol>{/** ol - ordered list, ul - unordered list */}
                                <li>Add ingredients</li>
                                <li>Add instructions in chronical order</li>
                                <li>Add image of the food served or while cooking</li>
                                <li>Save the recipe</li>
                                <li>Share with the world</li>
                            </ol>
                        </Card.Text>
                    </Card.Body>
                </Card>
            </Row>
            <Row className='my-3'>

                <Col sm={6}>
                    <input
                        value={recipeName}
                        placeholder="Recipe Name"
                        onChange={event => setRecipeName(event.target.value)}
                    />

                </Col>
            </Row>
            <Row className='my-5'>
                <Col sm={4}>
                    <Card>
                        <div className="fw-bold d-flex justify-content align-items-start">Ingredients</div>
                        {ingredientsrender}
                        <Button variant='primary' className='button mt-5 mx-5 mb-2'>Total Price Total€</Button>
                    </Card>


                </Col>
                <Col sm={8}>
                    <div className="fw-bold d-flex justify-content align-items-start">Instructions</div>
                    {instructiondummy}
                </Col>
                <Col sm={2}>

                </Col>

            </Row>
            <Row>
                <Col sm={4}><Button variant="secondary" onClick={saveRecipe}>Save Recipe</Button></Col>

            </Row>

        </Container>





    )


}